import "./Page4.css";
import React from "react";
import HexGridDemo from "./Grid.js";

function Page4() {
  return (
    <div>
      <div className="App">
        <HexGridDemo />
        <h1>Hello CodeSandbox</h1>
        <h2>Edit to see some magic happen!</h2>
      </div>
    </div>
  );
}
export default Page4;
